    // Function to add text layer with specific font
    function addTextLayerWithFont(text, fontName, addLineBreaks) {
        var comp = app.project.activeItem;
        if (comp instanceof CompItem) {
            var textLayer = comp.layers.addText(text);
            var textProperty = textLayer.property("Source Text");
            var textDocument = textProperty.value;
            textDocument.font = fontName;
            textProperty.setValue(textDocument);
            var fontSize = textDocument.fontSize;
            // textDocument.fontSize = fontSize; // Set font size

            if (addLineBreaks) {
                // Calculate maximum characters that can fit in one line
                var maxWidth = comp.width;
                var maxChars = Math.floor(maxWidth / (fontSize * 1)); // Adjust factor as needed

                if (text.length > maxChars) {
                    // Insert line breaks
                    textLayer.property("Source Text").setValue(text.replace(new RegExp('(.{1,' + maxChars + '})(\\s+|$)', 'g'), '$1\n'));
                }
            }
        } else {
            alert("Please select a composition.");
        }
    }

    // Function to add text based on selected option
    function addTextBasedOnSelection() {
        var selectedOption = pageListbox.selection.text;
        var optionText = pageTextMapping[selectedOption] || "";
        var font = "QCF_" + selectedOption;

        addTextLayerWithFont(optionText, font);
    }

    // Define add Basmala button functionality
    basmalaButton.onClick = function() {
        addTextLayerWithFont("321", "QCF_BSML");
    };

    // Define surahName button functionality
    surahNameButton.onClick = function() {
        var selectedSurah = surahNameListbox.selection.text;
        var optionText = surahTextMapping[selectedSurah];
        var font = "QCF_BSML";

        addTextLayerWithFont(optionText, font);
    };

    // Function to filter the surah list
    surahNameEdit.onChanging = function() {
        var filter = this.text.toLowerCase();
        surahNameListbox.removeAll();
        var keys = getKeys(surahTextMapping);
        for (var i = 0; i < keys.length; i++) {
            if (keys[i].toLowerCase().indexOf(filter) !== -1) {
                surahNameListbox.add('item', keys[i]);
                surahNameListbox.selection = 0;
            }
        }
    };

    // Function to filter the page list
    pageEdit.onChanging = function() {
        var filter = this.text.toLowerCase();
        pageListbox.removeAll();
        var keys = getKeys(pageTextMapping);
        for (var i = 0; i < keys.length; i++) {
            if (keys[i].toLowerCase().indexOf(filter) !== -1) {
                pageListbox.add('item', keys[i]);
                pageListbox.selection = 0;
            }
        }
    };

